import React from 'react';
import { Link } from 'react-router-dom'; // Ensure you're using react-router for SPA navigation

function Footer() {
    return (
        <footer style={{
            background: '#333', // Dark background for contrast
            color: 'white',
            padding: '20px',
            textAlign: 'center',
            fontFamily: '"Segoe UI", Tahoma, Geneva, Verdana, sans-serif',
            display: 'flex',
            flexDirection: 'row',
            alignItems: 'center',
            justifyContent: 'space-between' // Spaces out child elements evenly
        }}>
            {/* Logo Section */}
            <div style={{ flex: 1 }}>
                <img src="/path-to-your-logo.png" alt="Crystal Saddler Photography" style={{ maxWidth: '100px' }} />
            </div>

            {/* Navigation Links */}
            <nav style={{ flex: 2 }}>
                <ul style={{
                    listStyleType: 'none',
                    padding: 0,
                    display: 'flex',
                    justifyContent: 'center',
                    gap: '20px'
                }}>
                    <li><Link to="/" style={{ color: 'white', textDecoration: 'none', fontSize: '16px' }}>Home</Link></li>
                    <li><Link to="/about" style={{ color: 'white', textDecoration: 'none', fontSize: '16px' }}>About</Link></li>
                    <li><Link to="/contact" style={{ color: 'white', textDecoration: 'none', fontSize: '16px' }}>Contact Us</Link></li>
                </ul>
            </nav>

            {/* Email Section */}
            <div style={{ flex: 1, textAlign: 'right' }}>
                <p>crystalsaddlerphotography@yahoo.com</p>
            </div>
        </footer>
    );
}

export default Footer;
